  \"Sea otter distribution and abundance in western Prince William Sound, Alaska:
  Progress report 1984\",\n\t\"tracking_summary\": {\n\t\t\"total\": 3,\n\t\t\"recent\":
  2\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2016-07-27T23:02:30.868420\",\n\t\"name\": \"sea-otter-distribution-and-abundance-in-western-prince-william-sound-alaska-progress-repor\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sea otters recently recolonized Prince
  William sound (PWS), Alaska after being extirpated in the 18th and 19th centuries.
  Twenty-five years ago a few otters inhabited only the southern portion of PWS, but
  today they can be found throughout PWS. In the summer of 1984 we surveyed the entire
  coastline and sampled open water areas of western PWS for sea otters. We observed
  1,959 independent otters and 552 pups. Independent otters were not distributed evenly
  throughout PWS and pups were not distributed evenly with respect to independents.
  By comparing our data to 1973 Alaska Department of Fish and Game surveys, two points
  can made. First, the otter population in western PWS has not increased significantly,
  if at all since 1973. Second, there were fewer otters in central PWS and more otters
  in western PWS than in 1973. We caution that the otters in western PWS are not a
  discrete population free from immigration and emigration; therefore, to understand
  the population dynamics more extensive surveys are needed.\",\n\t\"license_title\":
